import React from 'react';
import { Box, Button, Container, Grid, Typography, Card, CardContent } from '@mui/material';
import { Link } from 'react-router-dom';
import SchoolIcon from '@mui/icons-material/School';
import BarChartIcon from '@mui/icons-material/BarChart';
import SmartToyIcon from '@mui/icons-material/SmartToy';
import PersonIcon from '@mui/icons-material/Person';
import Footer from '../components/Footer';

const HomePage = () => {
  return (
    <>
      {/* Hero Section */}
      <Box
        sx={{
          background: 'linear-gradient(to right, #1e3c72, #2a5298)',
          color: 'white',
          py: 8,
          textAlign: 'center',
        }}
      >
        <Container>
          <Typography variant="h2" fontWeight="bold" gutterBottom>
            Welcome to ExamsAI üöÄ
          </Typography>
          <Typography variant="h6" sx={{ mb: 4 }}>
            Your one-stop platform for mastering all competitive exams in India
          </Typography>
          <Button
            variant="contained"
            size="large"
            color="secondary"
            component={Link}
            to="/exams"
            sx={{ px: 4 }}
          >
            Explore Exams
          </Button>
        </Container>
      </Box>

      {/* Features Section */}
      <Container sx={{ py: 6 }}>
        <Typography variant="h4" textAlign="center" fontWeight="bold" gutterBottom>
          Why Choose ExamsAI?
        </Typography>
        <Grid container spacing={4} sx={{ mt: 3 }}>
          {[
            { icon: <SchoolIcon fontSize="large" />, title: 'Explore Exams', desc: 'Get detailed info about UPSC, NEET, SSC, JEE and more.' },
            { icon: <BarChartIcon fontSize="large" />, title: 'Visual Stats', desc: 'Charts showing exam trends and popularity.' },
            { icon: <SmartToyIcon fontSize="large" />, title: 'AI Assistant', desc: 'Generate revision plans and strategies with AI.' },
            { icon: <PersonIcon fontSize="large" />, title: 'Add Your Own', desc: 'Contribute and customize your own exam list.' },
          ].map((feature, i) => (
            <Grid item xs={12} sm={6} md={3} key={i}>
              <Card elevation={3} sx={{ textAlign: 'center', p: 2 }}>
                <CardContent>
                  <Box sx={{ mb: 1 }}>{feature.icon}</Box>
                  <Typography variant="h6" fontWeight="bold">{feature.title}</Typography>
                  <Typography variant="body2" color="text.secondary">{feature.desc}</Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* Testimonials */}
      <Box sx={{ backgroundColor: '#f5f5f5', py: 6 }}>
        <Container>
          <Typography variant="h4" textAlign="center" fontWeight="bold" gutterBottom>
            What Students Say üí¨
          </Typography>
          <Grid container spacing={4} sx={{ mt: 2 }}>
            {[
              {
                name: 'Ravi (JEE Aspirant)',
                text: 'ExamsAI gave me all the info and stats I needed. The AI planner is a game-changer!',
              },
              {
                name: 'Meena (UPSC Candidate)',
                text: 'The exam cards and visual charts helped me prioritize my study goals!',
              },
            ].map((t, i) => (
              <Grid item xs={12} sm={6} key={i}>
                <Card elevation={2}>
                  <CardContent>
                    <Typography variant="body1" fontStyle="italic">‚Äú{t.text}‚Äù</Typography>
                    <Typography variant="subtitle2" sx={{ mt: 1 }} align="right">‚Äì {t.name}</Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>

      {/* Footer */}
      <Footer />
    </>
  );
};

export default HomePage;
